import{_ as t,W as e,X as d,a2 as o}from"./framework-7d1f27fd.js";const r={},l=o('<h1 id="isset、empty、is-null-区别" tabindex="-1"><a class="header-anchor" href="#isset、empty、is-null-区别" aria-hidden="true">#</a> isset、empty、is_null 区别</h1><table><thead><tr><th>测试的特殊值</th><th>isset</th><th>empty</th><th>is_null</th></tr></thead><tbody><tr><td>0</td><td>true</td><td>true</td><td>false</td></tr><tr><td>FALSE</td><td>true</td><td>true</td><td>false</td></tr><tr><td>null</td><td>false</td><td>true</td><td>true</td></tr><tr><td>&quot;&quot;</td><td>true</td><td>true</td><td>false</td></tr><tr><td>&quot;0&quot;</td><td>true</td><td>true</td><td>false</td></tr><tr><td>空数组</td><td>true</td><td>true</td><td>false</td></tr><tr><td>$var</td><td>false</td><td>true</td><td>true</td></tr><tr><td>不存在的变量</td><td>false</td><td>true</td><td>true</td></tr></tbody></table><blockquote><p>总结：isset 返回 false 的情况是：<code>null、变量未初始化、未声明变量</code>。</p></blockquote><h4 id="isset-函数" tabindex="-1"><a class="header-anchor" href="#isset-函数" aria-hidden="true">#</a> isset() 函数</h4><p>格式：<code>bool isset ( mixed var [, mixed var [, ...]] )</code></p><p>功能：检测变量是否设置</p><p>返回值：</p><blockquote><p>若变量不存在则返回 FALSE。</p></blockquote><blockquote><p>若变量存在且其值为NULL，也返回 FALSE。</p></blockquote><blockquote><p>若变量存在且值不为NULL，则返回 TURE。</p></blockquote><blockquote><p>同时检查多个变量时，每个单项都符合上一条要求时才返回 TRUE，否则结果为 FALSE</p></blockquote><p>更多说明：<br> 使用 unset() 释放变量之后，它将不再是 isset()。PHP函数isset()只能用于变量，传递任何其它参数都将造成解析错误。<code>检测常量是否已设置可使用 defined() 函数。</code></p><h4 id="empty-函数" tabindex="-1"><a class="header-anchor" href="#empty-函数" aria-hidden="true">#</a> empty() 函数</h4><p>格式：<code>bool empty ( mixed var )</code></p><p>功能：检查一个变量是否为空</p><p>返回值：</p><blockquote><p>若变量不存在则返回 TRUE</p></blockquote><blockquote><p>若变量存在且其值为&quot;&quot;、0、&quot;0&quot;、NULL、FALSE、array()、var $var以及没有任何属性的对象，则返回 TURE</p></blockquote><blockquote><p>若变量存在且值不为&quot;&quot;、0、&quot;0&quot;、NULL、FALSE、array()、var $var以及没有任何属性的对象，则返回 FALSE</p></blockquote><p>更多说明：<br> empty()的返回值=!(boolean) var，但不会因为变量未定义而产生警告信息。参见转换为布尔值获取更多信息。 empty() 只能用于变量，传递任何其它参数都将造成Paser error而终止运行。<code>检测常量是否已设置可使用 defined() 函数</code>。</p><h4 id="is-null-函数" tabindex="-1"><a class="header-anchor" href="#is-null-函数" aria-hidden="true">#</a> is_null 函数</h4><p>格式：<code>is_null(mixed $value): bool</code></p><p>Finds whether the given variable is null.</p><blockquote><p>检测传入值【值，变量，表达式】是否是null，只有当变量定义了，且它的值是null，它才返回TRUE . 其它都返回 FALSE <code>【未定义变量传入后会出错!】</code></p></blockquote>',24),a=[l];function u(s,i){return e(),d("div",null,a)}const p=t(r,[["render",u],["__file","isset、empty、is_null的区别.html.vue"]]);export{p as default};
